import { __decorate } from "tslib";
import { Component } from '@angular/core';
let DogsPageComponent = class DogsPageComponent {
    constructor(dogCrudService, router) {
        this.dogCrudService = dogCrudService;
        this.router = router;
        this.dogs = [];
    }
    async ngOnInit() {
        this.dogs = await this.dogCrudService.getDogs();
    }
    handleNavigateToCreateEdit(dogId) {
        this.router.navigate(['./' + dogId]);
    }
};
DogsPageComponent = __decorate([
    Component({
        selector: 'app-dogs-page',
        templateUrl: './dogs-page.component.html',
        styleUrls: ['./dogs-page.component.scss']
    })
], DogsPageComponent);
export { DogsPageComponent };
